import React,{Component} from 'react';

class EmployeeID extends Component
{
    constructor(){
        super()
        
    }
    render(){
        return(
            <div>
                <label 
                className="label" >Employee ID
                <input 
                    type="number" 
                    className="input"
                    name="empid" 
                    value={this.props.empid} 
                    placeholder="1000-1100" 
                    onChange={this.handleOnChange} />
                </label>    
            </div>
        );
    }
}

export default EmployeeID;
